exclusiveMOVPerkDescription:function(){return"Upload videos that only your members, or members of a certain level, can watch. Think behind-the-scenes content, unreleased footage, rough cuts, bloopers, archived videos or live streams, or any video you\u2019d like to create specifically for your members. Members-only videos can be automatically added to a special playlist on your channel page, making them easy for members to discover."},
earlyAccessToNewVideosPerkDescription:function(){return"Giving your members early access to your upcoming videos \u2014 before you release them publicly \u2014 is an easy way to provide a tangible perk that members consistently look forward to. The longer the early access period, the more appealing it can be to members. You can do this by changing the visibility of the video when you upload it in Studio."},
moChatPerkDescription:function(){return"During a public live stream, you can turn on members-only chat mode. Non-members are able to see the chat, but only members can participate. Many channels promote this perk during their live streams to incentivize non-members to join the club."},
moChatsPerkDescription:function(){return"During a public live stream, you can turn on members-only chat mode. Non-members are able to see the chat, but only members (of all levels) can participate. Many channels promote this perk during their live streams to incentivize non-members to join the club."},
moLiveStreamPerkDescription:function(){return"Ever wanted to host a live stream with only your biggest fans? Here\u2019s your chance. Members-only live streams give your fans special access to you, unplugged. They\u2019re also a great chance for you to ask your members for feedback on your membership offering, like what type of content or perks they\u2019d like to see in the future."},
moPollsPerkDescription:function(){return"Member polls are a great way to get feedback on your channel from a loyal group of fans. Poll your members to help make decisions about your channel or memberships offering, or just for fun! Member feedback can be incredibly valuable not only for you, but it also gives members a chance to feel like they\u2019re part of your journey."},
priorityReplyToCommentsPerkDescription:function(){return"Consider responding to members\u2019 comments first. Members appreciate receiving this type of special treatment in exchange for being a paying member of your channel. Use Creator Studio to easily reply to member comments by filtering for \u2018channel members\u2019 in the comment review tool."},
moChatRoomsPerkDescription:function(){return"Some channels offer their members access to private chat groups via messaging platforms. Think of it as a private chat group with your biggest fans! Members can really value the ability to connect directly with each other, and to help build your community."},
gameplayWithYouPerkDescription:function(){return"Accept in-game friend requests from your members so that they can play alongside you."},
connectingOnSocialMediaPerkDescription:function(){return"Offer to follow or shout-out members on the social media platform of their choice."},
phototsAndStatusUpdatesPerkDescription:function(){return"Post your photos or status updates on your Community tab that only members can see. You can customize these posts to members at different levels. Members-only posts are a great way to notify your members about new or upcoming content, and to regularly stay in touch with them between video drops."},
exclusiveWallpapersPerkDescription:function(){return"Provide your members with exclusive mobile phone wallpapers branded with your channel\u2019s membership logo, badges, or even inside jokes \u2014 anything that\u2019s unique to your channel and its members. You can share these as members-only posts in your Community tab."},
exclusiveGIFsPerkDescription:function(){return"Provide your members with exclusive GIFs that only members can see in your Community tab. These could be inside jokes between you and your members, clips from members-only videos or live streams, quick glimpses of your life off-camera \u2014 anything you think your members would enjoy."},
